    "2013-03-15T11:16:27.490281",nt"name": "field-plot-and-accuracy-assessment-points-for-shenandoah-national-park-vegetation-mapping-proje",nt"isopen":
    false,nt"url": null,nt"notes": "This data set is an ESRI point shapefile.
    Points represent vegetation and accuracy assessment plots from which field data
    were collected as part of the Version 2.0 vegetation mapping project at Shenandoah
    National Park. Point features include 352 points that represent vegetation plots
    used in the quantitative analysis for this project: 208 plots collected from 2001-2003
    for the Version 1.1 park vegetation map; 14 plots sampled during the summer of 2007;
    27 plots sampled for the Rock Outcrop Management Plan inventory project (2005-2007);
    and 103 plots sampled by the Virginia Natural Heritage Program (1990-2000). Two
    hundred ninety-three (293) point features represent plots sampled during the Version
    1.1 accuracy assessment that were used in this effort to evaluate and assess vegetation
    distribution and composition. The remaining 703 points represent accuracy assessment
    plots from which field data were collected in the summer of 2008. Data from these
    703 plots were used to assess the accuracy of the Version 2.0 vegetation map.",nt"license_title":
